INSERT INTO `companies` VALUES ('a16e46ec-4c49-4632-a7af-b0bfe9409660','Netcompany','https://res.cloudinary.com/diiwznxk1/image/upload/v1686756574/vieclam/jdzvv5p9wpsx2wcy3dj4.gif','canducquang1201@gmail.com','0792020256','26 Ung Văn Khiêm, TP Hồ Chí Minh','<h2><strong>PART OF A GLOBAL SUCCESS</strong></h2><p class=\"ql-align-justify\"><strong>Netcompany&nbsp;</strong>was founded in 2000 and has its headquarters in Copenhagen, Denmark. Today, we are an international company with more than 6,500 employees working from 17 countries. We serve a wide array of customers in their digital transformation journeys in public and private sectors across Europe<strong>.&nbsp;</strong>We have strong and dedicated teams in Ho Chi Minh City, and you will have the opportunity to work with some of the most skilled Developers in Vietnam.</p><p class=\"ql-align-justify\">In&nbsp;<strong>Netcompany&nbsp;</strong>we are a unique community with a strong culture, which we nourish and cherish. We emphasize that the social aspect of work life is very important, and you probably will not find another place in the sector where it is as integrated a part of the company’s DNA and learn from the best across the countries.</p><p class=\"ql-align-justify\"><br></p><h2><strong>COMPANY WAY</strong></h2><p class=\"ql-align-justify\">As an employee in&nbsp;<strong>Netcompany&nbsp;</strong>you will also benefit from the internal knowledge-based communities, Center of Excellence. This covers a wide range of different groups, from specific technologies, project management, methodology to name a few. Combined, they offer the chance to learn from the best across the different countries.</p><p class=\"ql-align-justify\"><br></p><h2><strong>VISION</strong></h2><p>The leading digital challenger in Europe.</p><p><br></p><h2><strong>PURPOSE</strong></h2><p>Sustainable, prosperous societies driven by digitization.</p><p><br></p><h2><strong>IDEAL CANDIDATE</strong></h2><p>We are looking for talented Candidates to work with international Customers. You will be a part of effective Scrum teams and develop and study modern technologies.</p>','1000 - 4999 nhân viên','2023-06-14 22:31:30','2023-06-14 22:37:43'),('a1d5b6f2-d78d-4eae-9d1d-b7610bb9db62','Công ty TNHH MTV Chatte','https://res.cloudinary.com/diiwznxk1/image/upload/v1686790342/vieclam/ttmbm1ppxmrscc7cg8se.jpg','quangbruh123@gmail.com','908753959','123/11A XVNT','<p>ASKJDHA</p>','120 công ty, 120 nhân viên','2023-06-15 07:52:33','2023-06-15 07:52:33'),('bc74374d-d4e7-4d84-ace0-135d028b1aa7','VNG Corporation','https://res.cloudinary.com/diiwznxk1/image/upload/v1686756389/vieclam/aooe8ydgawfkbgeblrno.png','20520716@gm.uit.edu.vn','0908753959','VNG Campus Z06 Đường số 13, Phường Tân Thuận Đông, Quận 7, Thành phố Hồ Chí Minh','<h2><strong>COMPANY INTRODUCTION</strong></h2><p>Established in 2004, VNG is proudly the first unicorn in Vietnam with more than 3100 employees working in 5 countries.</p><p>Each day, millions of young Vietnamese entertain, connect, make friends and engage in social activities through VNG products such as Online Games (VLTK Mobile, Crossfire...), Platform (Zalo, Zing News), Payment (ZaloPay) and Cloud Service, which stands as an ample testimony to how VNG creates value for the society.&nbsp;</p><p><br></p><h2><strong>OUR MISSION</strong></h2><p>After 15 years \"Embracing challenges\", VNG has now moved towards a greater mission: \"Build Technologies and Grow People. For a better life\".</p><p>Staying true to \"embracing challenges\" spirit, we always seek to break the boundaries to deliver the cutting-edge products that are changing the way millions of people use technology. On top of that, human development is the foremost goal that VNG is always after to guarantee our success.</p><p><br></p><h2><strong>OUR CORE VALUE</strong></h2><p>There are 3 core values of VNG\s success:</p><p><strong>Embracing challenges</strong>: We always strive to go beyond all limits to overcome the challenges and, in doing so, continuously transform ourselves to the next level.&nbsp;</p><p><strong>Advancing Partnership</strong>: VNG believes that challenges are to be conquered when we join hands together.&nbsp;</p><p><strong>Upholding Integrity</strong>: Cultivating trust, transparency and integrity in every action is the best way to take us further on the path of integration.</p><p><br></p><h2><strong>OUR CULTURE</strong></h2><p>Open, friendly and extremely dynamic working environment are top-of-mind keywords for anyone when reflecting on VNG culture. Besides, VNG also offers many training workshops and mental healthcare for each Starter to enjoy their life at VNG.</p>','Trên 5000 nhân viên','2023-06-14 22:26:31','2023-06-14 22:36:21'),('c7272f17-cefd-4f15-a462-7ff02c1d90a3','FPT Software','https://res.cloudinary.com/diiwznxk1/image/upload/v1686755661/vieclam/waynwbhup3bi8sxlcjeo.jpg','quangbruh123@gmail.com','0908753959','Tòa nhà FPT Cầu Giấy, Phố Duy Tân, Quận Cầu Giấy, TP. Hà Nội','<p><span style=\"background-color: rgb(250, 250, 250); color: rgb(51, 51, 51);\">Thành lập từ năm 1988 đến nay với 3 Trụ sở chính FPT Software đặt tại Việt Nam và một số nước trên toàn thế giới như Hoa Kỳ, Nhật Bản, Malaysia, Đức, Úc, Singapore, Malaysia, Thái Lan và Phillipines hiện FPT Software đáp ứng nhu cầu gia công phần mềm lớn cho hơn 150 công ty hàng đầu tại 20 quốc gia lớn nhất trên thế giới hiện nay với các hợp đồng lớn có khi đạt cả 1 triệu USD dành cho một số đối tác lớn như Hitachi, NEOPOST, Petronas, Deutsche Bank, và Unilever với hơn 4000 nhân viên trên toàn thế giới.</span></p><p><br></p><p><span style=\"background-color: rgb(250, 250, 250); color: rgb(51, 51, 51);\">FPT Software theo đuổi mục tiêu gia công phần mềm để đáp ứng cho nhu cầu phát triển CNTT của các hãng phần mềm trong nước, các công ty lớn trong nước và tham vọng hơn là xuất khẩu phần mềm trên toàn thế giới cho các công ty nước ngoài biết đến tập đoàn FPT, mục đích chính là vươn đến tầm cao mới thông qua công nghệ nhằm nâng cao năng suất lao động</span></p><p><br></p><p><span style=\"background-color: rgb(250, 250, 250); color: rgb(51, 51, 51);\">Đến với FPT Software, nhân viên được phép phát huy tối đa khả năng sáng tạo, nỗ lực đưa các sáng tạo vào các giải pháp công nghệ thông tin nhằm nắm bắt các cơ hội đổi mới và phát triển nhằm đạt được mục tiêu chung của tập đoàn là OneFPT - Công ty xuất khẩu phần mềm hàng đầu tại Việt Nam</span></p><p><br></p><p><span style=\"background-color: rgb(250, 250, 250); color: rgb(51, 51, 51);\">Kinh doanh của FPT Sofware xuất phát từ Công nghệ thông tin và&nbsp;</span><a href=\"http://fpt.center/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: rgb(250, 250, 250); color: rgb(0, 51, 0);\"><strong>Viễn Thông FPT</strong></a><span style=\"background-color: rgb(250, 250, 250); color: rgb(51, 51, 51);\">&nbsp;là cốt lõi để đáp ứng cho khách hàng trên 63 tỉnh thành trên toàn lãnh thổ Việt Nam và mở rộng đến khách hàng toàn cầu. Từ khi được thành lập cho đến nay, FPT Software đã là công ty phần mềm số 1 tại Việt Nam trong lĩnh vực tích hợp hệ thống, phân phối và bán lẻ, dịch vụ Công Nghệ Thông tin, xuất khẩu gia công phần mềm, bán lẻ sản phẩm CNTT.</span></p><p><br></p><p><span style=\"background-color: rgb(250, 250, 250); color: rgb(51, 51, 51);\">Ỡ lĩnh vực Viễn Thông FPT là một trong 3 nhà cung cấp dịch vụ internet&nbsp;</span><a href=\"http://fpt.center/106-dang-ky-cap-quang-fpt-tphcm.html\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: rgb(250, 250, 250); color: rgb(0, 51, 0);\"><strong>cáp quang FPT</strong></a><span style=\"background-color: rgb(250, 250, 250); color: rgb(51, 51, 51);\">&nbsp;hàng đầu tại Việt Nam, Về lĩnh vực quảng cáo, FPT là đơn vị quảng cáo trực tuyến số 1 tại Việt Nam với trang báo điện tử VNExpress với hơn 42 triệu lượt truy cập mỗi ngày.</span></p><p><br></p>','Trên 500 nhân viên','2023-06-14 22:14:26','2023-06-14 22:14:26');
